import React, { Component } from 'react'
import classNames from 'classnames';

const listImg =[
    "./img/bespoke/slide1.jpg",
    "./img/bespoke/slide2.jpg",
    "./img/bespoke/slide3.jpg",
    "./img/bespoke/slide4.jpg",
    "./img/bespoke/slide5.jpg",
]

export default class SlideImage extends Component{
    constructor(){
        super()
        this.state = {
            active : 0
        }
    }

    getIndex(index){
        this.setState({active: index})
        console.log(this.state)
        
    }

    render(){
        return(
            <>
            <div> asdasd</div>
            <div>
                <div>
                    {listImg.map((img,index) => <img className={classNames('img-slide', {active_image: this.state==index} )} src={img} ></img>)}
                </div>
                <div>
                    {listImg.map((img, index) => <img src={img} onClick={() => this.getIndex(index) } ></img>)}
                </div>
            </div>
            </>
        )
    }
}
